import { RuleDTO } from '../statics/definitions.dto';
import styled from 'styled-components';

const RuleContainer = styled.div`
  padding: 8px 12px !important;
`;

export const Rule = ({ rule }: { rule: RuleDTO }) => {
  return (
    <a href="#">
      <RuleContainer>
        <p>{rule.name}</p>
      </RuleContainer>
    </a>
  );
};
